import Card from "./Card";

function HardCards() {
  return (
    <>
      <div className="flex flex-col">
        <Card number="0" description="hello" />
        <Card number="helow" description="hwllo" />
        <Card number="helow" description="hwllo" />
      </div>
    </>
  );
}

export default HardCards;
